import React from 'react';
import PropTypes from 'prop-types';

SearchList.propTypes = {
  resultData: PropTypes.array,
};

function SearchList(props) {
  const {resultData} = props;
  return (
    <div className='result__list'>
      {resultData.map((data) => (
        <div className='result__item' key={data.name}>
          <div className='result__thumbnail'>
            <img
              src={require(`../../assets/images/${data.image_url}`)}
              alt={data.name}
            />
          </div>

          <div className='info'>
            <h1 className='info__name'>{data.name}</h1>
            <p className='info__distance'>{data.distance}</p>
            <p className='info__tag'>{data.tag}</p>
            <p className='info__des'>{data.description}</p>
            <p className='info__type'>
              {data.free_cancel && 'Free cancellation'}
            </p>
            <p className='info__message'>
              {data.free_cancel &&
                'You can cancel later, so lock in this great price today!'}
            </p>
          </div>
          <div className='rating'>.rating</div>
        </div>
      ))}
    </div>
  );
}

export default SearchList;
